function Form({status = {enabled: false}, ok}) {
    console.log('wtf');
    console.log(ok);
   // console.log(enabled);
   // let yui = state.enabled;
    console.log(status.enabled);
    return (
        <div className= {'form' + " " + (status.enabled ? 'normal' : 'hidden')}>
            <form>
                <br/>
                <div>
                <input/>
                </div>
                <br/>
                <textarea/>

                <button type="submit">Create</button>
            </form>
        </div>
    );
}

export default Form
